import React, { useState } from "react";
import { Menu, Switch, Button, Col, Row } from "antd";
import { Link } from "react-router-dom";
import "./css/styles.css";
import Media from "react-media";
import {
  CalendarOutlined,
  AppstoreOutlined,
  SettingOutlined,
  HomeOutlined
} 
from "@ant-design/icons";
const Index = (props) => {
  const [current, setCurrent] = useState("home");
  const handleClick = (e) => {
    setCurrent(e.key);
  };
  const { SubMenu } = Menu;

  return (
    <div>
      <Media
        query="(max-width: 599px)"
        render={() => (
          <Menu
          style={{ width: 256 }}
          mode="horizontal"
        >
          <Menu.Item key="1" icon={<HomeOutlined />}>
           Home
          </Menu.Item>
          <Menu.Item key="2" icon={<CalendarOutlined />}>
            Navigation Two
          </Menu.Item>
          <SubMenu key="sub1" icon={<AppstoreOutlined />} title="Navigation Two">
            <Menu.Item key="3">Option 3</Menu.Item>
            <Menu.Item key="4">Option 4</Menu.Item>
            <SubMenu key="sub1-2" title="Submenu">
              <Menu.Item key="5">Option 5</Menu.Item>
              <Menu.Item key="6">Option 6</Menu.Item>
            </SubMenu>
          </SubMenu>
          <SubMenu key="sub2" icon={<SettingOutlined />} title="Navigation Three">
            <Menu.Item key="7">Option 7</Menu.Item>
            <Menu.Item key="8">Option 8</Menu.Item>
            <Menu.Item key="9">Option 9</Menu.Item>
            <Menu.Item key="10">Option 10</Menu.Item>
          </SubMenu>
        </Menu>
        )}
      />

      <Media
        query="(min-width: 599px)"
        render={() => (
          <Menu
          style={{ width: 256 }}
          defaultSelectedKeys={['1']}
          defaultOpenKeys={['sub1','sub2']}
          mode="inline"
        >
         <Menu.Item key="1" icon={<HomeOutlined />}>
           Home
          </Menu.Item>
          <SubMenu key="sub1" icon={<AppstoreOutlined />} title="Department">
            <Menu.Item key="3">Employees</Menu.Item>
            <Menu.Item key="4">Positions</Menu.Item>
          </SubMenu>
          <SubMenu key="sub2" icon={<CalendarOutlined />} title="Date">
            <Menu.Item key="7">Holidays</Menu.Item>
            <Menu.Item key="8">Leave</Menu.Item>
            <Menu.Item key="9">Attandance</Menu.Item>
          </SubMenu>
        
        </Menu>
        )}
      />
    </div>
  );
};

export default Index;
